&lt;p&gt;&lt;span style=&quot;font-family:arial&quot;&gt;In the question, a statement is given, followed by two arguments, I and II. You have to consider the statement to be true even if it seems to be at variance from commonly known facts. You have to decide which of the given arguments, if any, is a strong argument.&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statement:&lt;/strong&gt; Should speed breakers be banned?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument I&lt;/strong&gt;: Yes, data shows that number of accidents increase after putting the speed breakers.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Argument II:&lt;/strong&gt; No, it teaches fast drivers a lesson.&lt;/p&gt;

