&lt;p&gt;&lt;span style=&quot;font-family:arial&quot;&gt;निम्न प्रश्न में एक कथन और उसके बाद दो तर्क I और II दिए गये हैं। आपको दिए गये कथन को सत्य मानना है, भले ही वे ज्ञात तथ्यों से अलग प्रतीत होते हों। आपको तय करना है कि, निम्नलिखित तर्कों में से कौनसे तर्क सबल हैं और कौनसे तर्क दुर्बल हैं।&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt; क्या गति रोधकों पर प्रतिबन्ध लगा देना चाहिए?&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क I:&lt;/strong&gt; हां, आंकड़ें दर्शाते हैं कि गति रोधकों को लगाने के बाद दुर्घटनाओं की संख्या में वृद्धि हुई है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;तर्क II:&lt;/strong&gt; नहीं, ये तेज गति वाले चालकों को एक पाठ पढ़ाता है।&lt;/p&gt;

